import React from 'react';
import classes from './Searchbar.module.css'
import search from "./search.png";

function App() {
  return (
    <div className={classes.App}>
      <header className={classes.header}>
        <div className={classes.logo}>NN Engineers</div>
        <div className={classes.closebutton}>CLOSE</div>
        </header>
        <div className={classes.searchcontainer}>
            <div>
          <input type="text" className={classes.searchinput} placeholder="Search..."/>
          <button className={classes.searchbutton}>
            <img src={search} className={classes.search} alt="Search"/>
          </button>
          </div>
        </div>


    </div>
  );
}

export default App;
